  true,\n\t\"url\": null,\n\t\"notes\": \"_(Abstract):_  This web site contains high-resolution
  wind and solar resource maps and data for Pakistan.rnrn_(Purpose):_  The products
  contained on this web site were developed by the U.S. National Renewable Energy
  Laboratory (NREL) for the U.S. Agency for International Development's (USAID) South
  Asia Regional Initiative for Energy Cooperation (SARI/E).rnrn_(Supplemental Information):_
  The high-resolution (1-km) annual wind power maps were developed using a numerical
  modeling approach along with NREL's empirical validation methodology. The high-resolution
  (10-km) annual and seasonal solar resource maps were developed using weather satellite
  data incorporated into a site-time specific solar mapping approach developed at
  the U.S. State University of New York at Albany. The data products are in a GIS
  (Geographic Information Systems) format.rnrnhttp://www.nrel.gov/international/ra_pakistan.html\",\n\t\"license_title\":
